import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { getAllCompanies } from "../../actions/companies";
import { getAllEmployees } from "../../actions/employees";

const Header = props => {
  function logout() {
    localStorage.removeItem("access_token");
    props.history.push("/login");
  }

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <Link to="/home" className="nav-link">
        Home
      </Link>
      <div className="collpase navbar-collapse">
        <ul className="navbar-nav mr-auto">
          <li className="navbar-item">
            <Link to="/companies" className="nav-link">
              Companies {cosnole.log(this.props.companies)}
            </Link>
          </li>
          <li className="navbar-item">
            <Link to="/employees" className="nav-link">
              Employee
            </Link>
          </li>
          <li className="navbar-item">
            <button onClick={logout} className="nav-link">
              Logout
            </button>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export const mapStateToProps = state => {
  return {
    companies: state.companies.data,
    employees: state.employees.data
  };
};

export const mapDispatchToProps = dispatch => {
  return {
    getCompanies: dispatch(getAllCompanies()),
    getEmployees: dispatch(getAllEmployees())
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Header);
